import React from "react";
import { Card } from "../../UI/Card.styled";

const List = ({ fontSizes, UI, colors, items }) => {
  return (
    <>
      <Card bd={"1px solid red"}>
        <Card
          fw={"700"}
          fs={fontSizes.textHeader}
          bd={"1px solid blue"}
          height={"2rem"}
          cl={colors.darkGrey}
        >
          {items.Header}
        </Card>
        <Card mg={"2rem 1rem"} height={"10rem"} bd={"1px solid green"}>
          <Card dp={"grid"} gridC={"15% 85%"} bd={"1px solid yellow"}>
            <Card
              br={"50%"}
              bg={colors.darkGrey}
              height={"3rem"}
              width={"3rem"}
              fs={"0.8rem"}
              cl={"white"}
              pd={"1rem 0.6rem"}
            >
              2019
            </Card>
          </Card>
        </Card>
      </Card>
    </>
  );
};

export default List;
